char * createPolylineData(char * uidFrom, char *uidTo)
{
	double *dataFrom, *dataTo;
	int n[2];
	int size = 63;
	int *tmp = &size;
	BOOL result;

    char * polylineID = (char *)createDataObject(uidTo, __GO_POLYLINE__);
	if (polylineID == NULL)
    {
        return NULL;
    }

	getGraphicObjectProperty(uidFrom, __GO_DATA_MODEL_NUM_ELEMENTS__, jni_int, (void**)&tmp);
	n[0] = 1; n[1] = size;
	
	result = setGraphicObjectProperty(polylineID, __GO_DATA_MODEL_NUM_ELEMENTS_ARRAY__, &n, jni_int_vector, 2);
	if (result == FALSE)
    {
            deleteDataObject(polylineID);
            return NULL;
    }

	getGraphicObjectProperty(uidFrom, __GO_DATA_MODEL_X__, jni_double_vector, (void**)&dataFrom);
	getGraphicObjectProperty(uidTo, __GO_DATA_MODEL_X__, jni_double_vector, (void**)&dataTo);

	memcpy(dataTo, dataFrom, sizeof(double)*3*size);
	return uidTo;
	
}

BOOL translatePolyline(char *uid, double x, double y, double z)
{
    double *datax = NULL;
    double *datay = NULL;
	double *dataz = NULL;

    int i = 0;
    if (x != 0.0)
    {
        datax = getDataX(uid);
        if (datax == NULL) return FALSE;
        for (i = 0; i < getDataSize_(uid); ++i)
        {
            datax[i]+= x;
        }
    }
    if (y != 0.0)
    {
        datay = getDataY(uid);
        if (datay == NULL) return FALSE;
        for (i = 0; i < getDataSize_(uid); ++i)
        {
            datay[i]+= y;
        }
    }
	if (z != 0 && isZCoordSet(uid))
	{
		dataz = getDataZ(uid);
        if (dataz == NULL) return FALSE;
        for (i = 0; i < getDataSize_(uid); ++i)
        {
            dataz[i]+= z;
        }
	}

	return TRUE;
}

BOOL translatePoint(char * uid, int index, double x, double y, double z)
{
    double *datax = NULL;
    double *datay = NULL;
    double *dataz = NULL;

    int size = getDataSize_(uid);

	if (index >= 0 && index < size) 
	{
		datax = getDataX(uid);
		if (datax == NULL) return FALSE;
		datay = getDataY(uid);
		if (datay == NULL) return FALSE;

		datax[index] += x;
		datay[index] += y;

		if (z != 0 && isZCoordSet(uid))
		{
			dataz = getDataZ(uid);
			dataz[index] += z;
		}
	}
	/*update*/
	setGraphicObjectProperty(uid, __GO_DATA_MODEL__, uid, jni_string, 1);
	return TRUE;
}

